import React, { Component } from "react";
// Importando os components necessários da lib react-materialize
import 'react-awesome-slider/dist/styles.css';
import { compose } from 'redux';
import { connect } from "react-redux";



class Escolha extends Component {

    handleLogout = () => {
        const { dispatch } = this.props;
        dispatch(logoutUser());
    };

    render() {
        const { isLoggingOut, logoutError } = this.props; return (
            <div>
                <div className="Titulo">
                    <span>Página Inicial SDFSDF</span>
                    <div className="Meio">
                        <p>Bem vindo ao site sobre cancro europeu! <br></br>Você pode navegar pelas diferentes seções através do cabeçalho logo acima.</p>
                        <button className="myButton" onClick={this.handleLogout}>Sair</button>
                        {isLoggingOut && <p>Logging Out....</p>}
                        {logoutError && <p>Error logging out</p>}
                    </div>
                </div>
            </div>
        );
    }
}
